import React from 'react';

function Shop(props) {

    const myStyle = {
        justifyContent: 'center',
        alignItems: 'center',
        width: '300px',
        height: '300px',
        fontSize: '23px',
        marginLeft: '300px'
    }

    return (

        <div className="shop" style={myStyle}>
            <img  style={myStyle}src="https://thumbs.dreamstime.com/b/shop-building-colorful-isolated-white-33822015.jpg" alt=""/>
            <p style={myStyle} >Place where you can buying clothes and make your life happy </p>
        </div>
    );
}

export default Shop;
